def is_prime(n):
    if n < 2:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    for i in range(3, int(n**0.5) + 1, 2):
        if n % i == 0:
            return False
    return True

This code defines a function is_prime that takes an integer n as input. It checks if n is less than 2, in which case it returns False. It then checks if n is equal to 2, in which case it returns True. If n is neither less than 2 nor equal to 2, it checks if n is divisible by 2. If it is, it returns False. If n is not divisible by 2, it checks if n is divisible by any odd number between 3 and the square root of n. If it finds any divisor, it returns False. If it doesn't find any divisor, it returns True, indicating that n is prime.

